import React from 'react'

import Pi from '../Pi/Pi'
import Title from '../Title/Title'



function DashboardPage() {
  return (
    <div class="container-fluid">
      <div class="row">
        <Title class="col-12 text-center">Quantit√© de Travail</Title>
      </div>
      <div class="row">
        <Pi class="col-12" prenom="Alexandre" nom="Thirion" totem="Alaskan" timing="1"></Pi>
      </div>
    </div>
  )
}

export default DashboardPage;
